description:
Verenigde Staten / Taiwan
Avontuur / Drama
127 minuten

een mooie film

met Suraj Sharma, Irrfan Khan en Ayush Tandon

Het leven van Pi vertelt het ongelooflijke verhaal van Piscine Patel, een zestienjarige Indiase jongen, wiens vader een 
dierentuin in India heeft. Wanneer de familie besluit het land te verlaten wordt de hele dierentuin ingescheept. Maar het schip 
vergaat en de enige overlevenden op de reddingssloep zijn Pi, een hyena, een zebra met een gebroken been, een orang-oetang en een
tijger van 200 kilo.
